import React from 'react';

const WorkoutTracker = ({ repCount, feedback }) => {
  return (
    <div className="workout-tracker">
      <div className="rep-counter">
        <h3>Reps</h3>
        <p>{repCount}</p>
      </div>
      <div className="feedback">
        <h3>Feedback</h3>
        <p>{feedback || 'Keep going!'}</p>
      </div>
    </div>
  );
};

export default WorkoutTracker;
